import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container-fluid">
        <div className="row">
          <div className="col-4">
            <div className="row">
              <div class="input-group input-group-sm mb-3">
                <span className="input-group-text" id="inputGroup-sizing-sm">Select PBT</span>
                <input type="text" className="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-sm" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
